import React from "react";
import northernDevsLogo from "../../assets/northernDevsLogo.png";
import vscode from "../../assets/vscode.png";
import firebase from "../../assets/firebase.png";
import webflow from "../../assets/webflow.png";
import sendGrid from "../../assets/sendGrid.png";
import "./about.css";
const About = () => {
  return (
    <section id="about">
      <span className="aboutHeading">What I do</span>
      <div className="aboutContent">
        <img
          src={northernDevsLogo}
          alt="Northern Devs"
          className="northernDevsLogo"
        />
        <div className="aboutDescription">
          <span className="aboutParagraph">
            I'm a full-stack developer at Northern-Devs for more than 10
            months.I mainly focus on implementing and designing of typescript
            components and firebase cloud functions for Launchpad.
          </span>
        </div>
      </div>
    </section>
  );
};

export default About;
